import React, {useState, useEffect} from 'react';
import axios from 'axios';
import { useNavigate} from 'react-router-dom';

const Register = (props) => {

    const [confirmReg, setConfirmReg] = useState("");
    const [errors, setErrors] = useState({});
    const navigate = useNavigate();

    const [user, setUser] = useState({
        firstName: "",
        lastName: "",
        email: "",
        gender: "",
        password: "",
        confirmPassword: ""
    });

    const handleChange = (e) => {
        setUser ({
            ...user,
            [e.target.name]: e.target.value,
        });
    };

    const register = (e) => {
        e.preventDefault();
        axios.post(`http://localhost:8000/api/users/register`, user,{
            withCredentials: true
        })
        .then( (res) => {
            console.log(res.data);
            setUser({
                firstName: "",
                lastName: "",
                email: "",
                gender: "",
                password: "",
                confirmPassword: ""
            })
            setConfirmReg("Thank you for Registering, you can now log in");
            setErrors({});
            navigate('/home');
        })
        .catch((err) => {
            console.log(err);
        })
    }

    return(
    <>
    <h1>Register</h1>
    {confirmReg ? <h4>{confirmReg}</h4> : null}
    <form onSubmit={register}>
        <div>
            <label>First Name:</label>
            <input type="text" name="firstName" value={user.firstName} onChange={(e) => handleChange(e)} />
            {errors.firstName ? (
                <span className='error-text'>
                    {errors.firstName.message}
                </span>
            ): null}
        </div>

        <div>
            <label>Last Name:</label>
            {errors.lastName ? (
                <span className='error-text'>
                    {errors.lastName.message}
                </span>
            ): null}
            <input type="text" name="lastName" value={user.lastName} onChange={(e) => handleChange(e)} />
        </div>

        <div>
            <label>Gender:</label>
            {errors.gender ? (
                <span className='error-text'>
                    {errors.gender.message}
                </span>
            ): null}
            <select value={user.gender} name="gender" onChange={(e) => handleChange(e)} >
                <option >---</option>
                <option value="Male">Male</option>
                <option value="Female">Female</option>
                <option value="Agender">Agender</option>
                <option value="Cisgender">Cisgender</option>
                <option value="Genderfluid">Genderfluid</option>
                <option value="Genderqueer">Genderqueer</option>
                <option value="Intersex">Intersex</option>
                <option value="Gender Nonconforming">Gender Nonconforming</option>
                <option value="Transgender">Transgender</option>
            </select>
        </div>

        <div>
            <label>Email:</label>
            {errors.email ? (
                <span className='error-text'>
                    {errors.email.message}
                </span>
            ): null}
            <input type="text" name="email" value={user.email} onChange={(e) => handleChange(e)} />
        </div>

        <div>
            <label>Password:</label>
            {errors.password ? (
                <span className='error-text'>
                    {errors.password.message}
                </span>
            ): null}
            <input type="password" name="password" value={user.password} onChange={(e) => handleChange(e)} />
        </div>

        <div>
            <label>Confirm Password:</label>
            {errors.confirmPassword ? (
                <span className='error-text'>
                    {errors.confirmPassword.message}
                </span>
            ): null}
            <input type="password" name="confirmPassword" value={user.confirmPassword} onChange={(e) => handleChange(e)} />
        </div>

        <div>
            <button type='submit'>Register</button>
        </div>

    </form>

    </>

    )
}

export default Register;
